CREATE DEFINER=`root`@`localhost` PROCEDURE `add_category` (IN `new_name` CHAR(100), IN `new_description` VARCHAR(500), IN `new_icon` BLOB, IN `parent_id` INT)  BEGIN
	SELECT @myLeft := lft FROM categories
	WHERE id = parent_id;

	UPDATE categories SET rgt = rgt + 2 WHERE rgt > @myLeft;
	UPDATE categories SET lft = lft + 2 WHERE lft > @myLeft;

	INSERT INTO categories(name, description, icon, lft, rgt) VALUES(new_name, new_description, new_icon, @myLeft + 1, @myLeft + 2);
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `remove_category` (IN `old_id` INTEGER)  BEGIN
	SELECT @myLeft := lft, @myRight := rgt, @myWidth := rgt - lft + 1
	FROM categories
	WHERE id = old_id;

	DELETE FROM categories WHERE lft BETWEEN @myLeft AND @myRight;

	UPDATE categories SET rgt = rgt - @myWidth WHERE rgt > @myRight;
	UPDATE categories SET lft = lft - @myWidth WHERE lft > @myRight;
END$$

